Introducci√≥n
Desde la Direcci√≥n Nacional de Mercados y Estad√≠stica (DNMyE) se avanz√≥ en la elaboraci√≥n y publicaci√≥n de una nueva herramienta para la medici√≥n y el an√°lisis del turismo en las localidades del pa√≠s. En una primera instancia, se present√≥ el Documento de Trabajo N¬∞8: Clasificaci√≥n de localidades seg√∫n nivel de desarrollo tur√≠stico con una propuesta de clasificaci√≥n del desarrollo tur√≠stico en base a la cantidad de plazas, dato que surge del Padr√≥n √önico Nacional de Alojamiento (PUNA). A fines de profundizar el an√°lisis, mejorar la calidad de la informaci√≥n y consolidar un instrumento de gesti√≥n se dise√±√≥ una nueva propuesta metodol√≥gica, la cual se describe a continuaci√≥n.
√çndice Tur√≠stico de Localidades
El nuevo √çndice Tur√≠stico de Localidades (ITL), cuya metodolog√≠a y resultados se encuentran desarrollados en el Documento de Trabajo N¬∞13, contempla una serie de indicadores, elaborados a partir de diversas fuentes, que permiten caracterizar la actividad tur√≠stica de un destino con un enfoque multidimensional.
En su primera versi√≥n, el √≠ndice de plazas sirvi√≥ como aproximaci√≥n para la clasificaci√≥n de localidades en tres categor√≠as: Emergentes, En desarrollo y Consolidadas. A partir de la nueva propuesta, el ITL contempla m√°s informaci√≥n que permite afinar esta clasificaci√≥n.
Se considera que la medici√≥n de la actividad tur√≠stica a nivel de localidades es una tarea dif√≠cil, en tanto requiere de la disponibilidad de datos de calidad y con una cobertura geogr√°fica y temporal acorde. Por esto, se realiz√≥ un proceso de exploraci√≥n, revisi√≥n, limpieza, procesamiento y normalizaci√≥n de fuentes de datos que permitieran cumplir con lo mencionado. Es as√≠, que se eligieron los siguientes indicadores, agrupados en dimensiones relevantes para el turismo, para la construcci√≥n del ITL:
Dimensi√≥n: Oferta
Cantidad de plazas
Cantidad de establecimientos de alojamiento
Cantidad de empresas registradas vinculadas a ramas caracter√≠sticas del turismo (RCT)
Dimensi√≥n: Demanda
Cantidad de pasajeros que transitaron por la terminal de √≥mnibus
Dimensi√≥n: Conectividad A√©rea
Conectividad de cabotaje
Conectividad internacional
Dimensi√≥n: Econom√≠a
Proporci√≥n de puestos de trabajo en RCT
Dimensi√≥n: Estacionalidad
Estacionalidad de la demanda
Fuentes de datos
Estos ocho indicadores seleccionados para representar el caracter multidimensional del turismo surgen, principalmente, de las siguientes fuentes de datos:
Administraci√≥n Nacional de Aviaci√≥n Civil (ANAC)
Comisi√≥n Nacional de Regulaci√≥n del Transporte (CNRT)
Padr√≥n √önico Nacional de Alojamiento (PUNA)
Centro de Estudios para la Producci√≥n - Ministerio de Econom√≠a (CEPXXI)
Base de Asentamientos Humanos de la Rep√∫blica Argentina (BAHRA)
