Presentaci√≥n
En forma complementaria a la elaboraci√≥n del Documento de Trabajo N¬∞5 - Informe de cadena de valor del turismo, la Direcci√≥n Nacional de Mercados y Estad√≠sticas (DNMyE) realiz√≥, en marzo de 2022, una encuesta a prestadores tur√≠sticos inscriptos en programas del Ministerio de Turismo y Deportes de la Naci√≥n. Con ella se busc√≥ conocer las principales fortalezas y desaf√≠os que enfrentan los diferentes actores que componen la cadena de valor del sector, as√≠ como el impacto de la pandemia sobre la actividad y las nuevas tendencias esperadas por los prestadores.
La encuesta consisti√≥ en un formulario online, de respuesta an√≥nima y no obligatoria, dividido en cinco bloques. El primer bloque, general a todos los prestadores, busc√≥ relevar las caracter√≠sticas principales de los participantes. El segundo bloque se centr√≥ en preguntas espec√≠ficas para los rubros de alojamiento, agencias de viajes y transporte. En el tercer bloque se consult√≥ sobre el impacto de la pandemia en la actividad y acerca de la utilizaci√≥n de programas de auxilio del Estado y l√≠neas de financiamiento. El bloque cuatro estuvo destinado a conocer las principales limitaciones enfrentadas por los encuestados en los rubros y provincias o regiones en las que operan, y las soluciones potenciales para superar dichas restricciones. Por √∫ltimo, el quinto bloque ahond√≥ sobre las tendencias esperadas en el sector tur√≠stico en la pospandemia.
En total, la encuesta fue enviada por mail a 19.258 prestadores de servicios de alojamiento, agencias de viajes, transporte, gastronom√≠a, gu√≠as de turismo, entre otros, y respondida por 2.882.
Caracter√≠sticas generales
De acuerdo con el relevamiento realizado, las cuatro grandes categor√≠as consideradas n√∫cleo (Agencias de viajes, Transporte, Alojamiento y Gastronom√≠a) representan el 70% del total de encuestados. El restante 30% se reparte entre otras actividades productoras de bienes y servicios complementarios y aquellos desarrollados en parques nacionales, playas, museos y parques tem√°ticos. Los gu√≠as de turismo y los prestadores dedicados a las excursiones representan una porci√≥n significativa de los encuestados, con un 12% y 10%, respectivamente.


