De acuerdo con el relevamiento realizado, se observan respuestas dispares en relaci√≥n a la variaci√≥n de la cantidad de trabajadores respecto de 2019. La opci√≥n que indica que no vari√≥ la dotaci√≥n de trabajadores, y aquella que muestra una ca√≠da mayor al 25% representan la mayor√≠a de las respuestas. Los rubros alojamiento, agencias de viajes, gastronom√≠a, transporte y venta de artesan√≠as tienen como respuesta m√°s frecuente el mantenimiento de la dotaci√≥n. En cambio, los servicios de gu√≠as de turismo y de excursiones muestran una ca√≠da superior al 25% como respuesta m√°s elegida.



Con el fin de mitigar los efectos de la pandemia en este sector, el gobierno implement√≥ un paquete de medidas en el per√≠odo 2020-2021. En ese marco, el 85% de los encuestados se√±al√≥ haber recibido alg√∫n tipo de asistencia. Entre los principales programas utilizados por las empresas/trabajadores independientes, aparecen APTur, con 954 respuestas, PreViaje (666), REPRO 2 (625) y ATP (620).



Complementariamente a los programas de asistencia, estuvieron vigentes distintas l√≠neas de cr√©dito orientadas a financiar capital de trabajo e inversiones. De acuerdo con la encuesta, el 33% de los consultados tuvo acceso a ellas. Los porcentajes m√°s elevados correspondieron a las categor√≠as gastronom√≠a (43,5%) y alojamiento (39%).
Limitantes para el desarrollo y posibles soluciones
Frente a la consulta sobre los limitantes al desarrollo del sector, se destaca la menci√≥n a la insuficiente infraestructura en el rubro alojamiento, gu√≠a de turismo y excursiones. Las dificultades de acceso al cr√©dito son relevantes en agencias de viajes, transporte y gastronom√≠a. Los problemas de conectividad fueron elegidos por prestadores de agencias de viaje y alojamiento. La falta de promoci√≥n tur√≠stica es se√±alada por gu√≠as de turismo, organizadores de excursiones y alojamientos. La dificultad de contrataci√≥n en puestos operativos es se√±alada en el rubro gastron√≥mico como limitante m√°s frecuente.



Adicionalmente, se pregunt√≥ qu√© pol√≠ticas consideran los prestadores que podr√≠an ayudar a superar las limitaciones antes mencionadas. La opci√≥n por facilidades de financiamiento ocup√≥ un lugar destacado. La inversi√≥n en infraestructura complementaria para la puesta en valor de los destinos tur√≠sticos es una opci√≥n mencionada especialmente entre prestadores de alojamiento, gu√≠as de turismo, excursiones, transporte y venta de artesan√≠as. Los programas de promoci√≥n de los destinos, as√≠ como aquellos de consolidaci√≥n de la oferta y la generaci√≥n de nuevos productos, circuitos y rutas complementarias, fueron otras de las pol√≠ticas predominantes entre las elecciones de los prestadores.
Prospectiva
La pandemia ha modificado los comportamientos y gustos de los viajeros, con creciente inter√©s en lo natural, lo personalizado o en grupos reducidos y con cierta flexibilidad a posibles contingencias. De la encuesta, surge que la principal transformaci√≥n fue, previsiblemente, una mayor preferencia por el turismo dentro del pa√≠s. En este sentido, el inter√©s por el turismo de naturaleza muestra una participaci√≥n destacada. El aumento de las reservas de √∫ltimo momento y con posibilidades de cancelaci√≥n destacan entre las respuestas de los prestadores de agencias de viajes. La preferencia por destinos tur√≠sticos no masivos est√° presente tambi√©n en prestadores de excursiones, gastronom√≠a y transporte.



La gran mayor√≠a de los encuestados considera que estos cambios se mantendr√°n en los pr√≥ximos a√±os: todas las categor√≠as muestran valores cercanos al 80% respondiendo afirmativamente.
Hasta aqu√≠ se presentan los principales resultados. El informe incluye adem√°s un an√°lisis con mayor detalle de cada bloque de la encuesta y una secci√≥n especial para el bloque dos, que contiene preguntas espec√≠ficas para los rubros Alojamientos, Agencias de viaje y Transporte.
