La Direcci√≥n Nacional de Mercados y Estad√≠stica (DNMyE) elabor√≥ un informe que procura examinar las caracter√≠sticas de la estacionalidad tur√≠stica en Argentina a partir de distintas mediciones y fuentes de informaci√≥n. Contiene un an√°lisis en base a datos de la ocupaci√≥n hotelera obtenidos de la Encuesta de Ocupaci√≥n Hotelera (EOH) y una caracterizaci√≥n de la estacionalidad ampliada hacia la totalidad de los destinos del pa√≠s con datos de empleo registrado publicados por el Centro de Estudios para la Producci√≥n (CEP XXI). Adicionalmente, se estudia la estacionalidad en aquellos departamentos o partidos con relevancia en t√©rminos de empleo tur√≠stico y a nivel provincial para observar las particularidades de cada jurisdicci√≥n.
La estacionalidad de la demanda constituye una caracter√≠stica inherente del sector tur√≠stico. El comportamiento estacional, para el caso de Argentina, es marcado en los primeros meses del a√±o, con una recuperaci√≥n en julio, mes de las vacaciones de invierno. Sin embargo, este fen√≥meno no es homog√©neo entre destinos. Observando algunas de las 49 localidades relevadas por la EOH, puede verificarse que conviven destinos con actividad m√°s estable a lo largo del a√±o, como la Ciudad Aut√≥noma de Buenos Aires (CABA), localidades con picos en verano, como Villa Gesell; otros en la temporada invernal, como el caso de Salta en julio; y, por √∫ltimo, casos, como el de San Mart√≠n de los Andes, con 2 temporadas altas en un mismo a√±o.



Estacionalidad en la ocupaci√≥n hotelera
Tomando como indicador de estacionalidad el porcentaje que representa el mes de mayor actividad ‚Äìen este caso las pernoctaciones en hoteles y parahoteles- respecto respecto del promedio del a√±o, se observa que destinos como Mar del Plata, Villa Gesell en la Costa Atl√°ntica, Bariloche en la Patagonia y Salta en el Norte, tienen un mes donde las pernoctaciones superan en un 50% al promedio del a√±o. En cambio, CABA muestra, en su mes de mayor actividad, menos de un 25% respecto de la media anual. En t√©rminos generales, las capitales de las provincias muestran una estacionalidad baja o media.












Estacionalidad en el empleo
Para tener una caracterizaci√≥n de la estacionalidad de la totalidad de los destinos del pa√≠s, se tomaron los datos abiertos de empleo registrado por departamento/partido y sector de actividad, publicados por el Centro de Estudios para la Producci√≥n (CEP XXI) de la Secretar√≠a de Industria y Desarrollo Productivo de la Naci√≥n, en base a informaci√≥n del Sistema Integrado Previsional Argentino (SIPA).
Una mirada a nivel nacional permite ver que, m√°s all√° de la tendencia decreciente desde 2018 y la recuperaci√≥n de los √∫ltimos meses, se observa especialmente la estacionalidad en el empleo en Servicios de Alojamiento, con el nivel creciendo hasta alcanzar un m√°ximo en el mes de enero y luego reduci√©ndose hasta un m√≠nimo en junio. Sucede lo mismo con la gastronom√≠a, si bien solo una parte de su producci√≥n es consumida por visitantes.







Tomando los departamentos o partidos con relevancia en t√©rminos de empleo tur√≠stico (aquellos que tienen 250 o m√°s puestos o bien aquellos que representan el 5% o m√°s del empleo en alojamiento de la provincia), podemos ver que los partidos de la costa bonaerense tienen una fuerte estacionalidad, al igual que C√≥rdoba y el departamento de R√≠o Hondo, en Santiago del Estero. En La Costa, el empleo de enero fue un 107% mayor al de la media del a√±o.












Caracterizaci√≥n provincial
La caracterizaci√≥n de la estacionalidad, medida como el porcentaje del empleo registrado en un mes con respecto al promedio del a√±o, puede realizarse tambi√©n a nivel provincial, para observar las particularidades de cada una de ellas.










Tomando el mes con mayor cantidad de puestos de trabajo y su desv√≠o respecto de la media, es posible observar que la mayor√≠a de las provincias tienen su pico en enero, febrero y diciembre. C√≥rdoba, por ejemplo, tuvo un 20,5% m√°s de empleo en enero con respecto al promedio del a√±o. Mendoza es el ejemplo opuesto: el mes con mayor empleo (febrero) es solamente un 1,7% m√°s que el promedio del a√±o.


