Las DGA tienen por objetivo garantizar la calidad ambiental, social y cultural de las organizaciones tur√≠sticas a trav√©s de la difusi√≥n de un conjunto de recomendaciones capaces de guiar a dichas entidades hacia el establecimiento de un sistema de gesti√≥n ambiental, que contribuya a la calidad de servicio, solucione y aten√∫e los impactos producidos y minimice los costos de gesti√≥n y adaptaci√≥n. En este sentido, la implementaci√≥n de estas directrices en una localidad apunta a producir un impacto global y busca instalar una gesti√≥n ambiental integrada del destino, involucrando a los sectores p√∫blico y privado, en la medida de que ello sea posible.
