¬øCON QU√â INFORMACI√ìN CONTAMOS DEL TURISMO NACIONAL EN NUESTRO PAIS?
Introducci√≥n
Desde la Direcci√≥n Nacional de Mercados y Estad√≠stica del Ministerio de Turismo y Deportes de la Naci√≥n (DNMyE ‚Äì MINTURDEP) nos proponemos seguir dando a conocer otra de las fuentes de informaci√≥n m√°s importantes a nivel nacional del turismo en Argentina. En esta oportunidad nos ocuparemos de la Encuesta de Viajes y Turismo de los Hogares (EVyTH).
A partir de esta encuesta se obtiene informaci√≥n desagregada del comportamiento tur√≠stico de los hogares de nuestro pa√≠s y permite tomar dimensi√≥n, en t√©rminos econ√≥micos, del peso del turismo interno en el conjunto del consumo de bienes y servicios tur√≠sticos en la Argentina. Con dicha informaci√≥n se pueden efectuar estudios anal√≠ticos de los diferentes determinantes de la actividad tur√≠stica de los residentes en nuestro pa√≠s y, por tanto, dise√±ar e implementar pol√≠ticas p√∫blicas sectoriales con mayor eficacia y eficiencia.
Principales objetivos
Este operativo tiene como principales objetivos medir:
La evoluci√≥n de los viajes realizados por los hogares en el periodo de referencia
Las caracter√≠sticas de los recorridos tur√≠sticos (lugares visitados, forma de alojamiento, estad√≠as, utilizaci√≥n de paquete tur√≠stico, medios de transporte, etc.)
Los viajes a segundas viviendas
El gasto de cada uno de los viajes
Los aspectos socio-demogr√°ficos de los hogares viajeros (ingreso total del hogar, ocupaci√≥n principal del jefe de hogar, etc.).
Marco conceptual: definici√≥n de viaje tur√≠stico
Siguiendo las definiciones habituales y las recomendaciones internacionales de la Organizaci√≥n Mundial del Turismo, a los efectos del relevamiento de la EVyTH, se define como viaje de turismo a todo aquel desplazamiento realizado por todos, algunos o al menos uno de los miembros del hogar fuera de su entorno habitual (las segundas viviendas por definici√≥n no forman parte). Debe tenerse en cuenta que:
Debe tener una duraci√≥n inferior a un a√±o y quien viaj√≥ no haber fijado su residencia en el lugar de destino.
Comprende los traslados, estancias y todas las actividades que las personas realizan en el lugar de destino.
Puede haber ido a un s√≥lo destino o haber tenido varias etapas.
Unidades de an√°lisis
El marco conceptual antes definido permite obtener conclusiones a partir de diversas unidades de an√°lisis. A continuaci√≥n, se las repasan junto con una breve descripci√≥n de cada una de ellas:
Hogar: es la persona o grupo de personas, parientes o no, que habitan bajo un mismo techo en un r√©gimen de tipo familiar; es decir, comparten sus gastos en alimentaci√≥n con cargo a un mismo presupuesto.
Persona: cada uno de los individuos integrantes de un hogar.
Turista: significa el desplazamiento que realiza una persona fuera del entorno habitual, con una duraci√≥n inferior al a√±o, pernoctando en el/los lugar/es de destino, por cualquier motivo excepto de ser empleado por una unidad residentes.
Visita de un d√≠a: es el recorrido de una persona fuera del entorno habitual sin pernoctar en el lugar de destino.
Pernoctaci√≥n: se trata de una noche de alojamiento de una persona.
Principales caracter√≠sticas de la encuesta
La EVyTH es una encuesta por muestreo, cuya captaci√≥n se lleva adelante bajo la metodolog√≠a CATI (Computer Assisted Telephone Interviewing). El universo bajo estudio de la encuesta son los grandes aglomerados urbanos definidos en la EPH del INDEC. Por lo tanto, se consideran 32 aglomerados agrupados en 8 regiones (Ciudad Aut√≥noma de Buenos Aires, Partidos del Gran Buenos Aires, Resto de la Provincia de Buenos Aires, C√≥rdoba, regi√≥n del Litoral, Norte, Cuyo y Patag√≥nica).
El tama√±o de muestra mensual es de 2.600 hogares distribuidos entre todos los aglomerados. La ventana de observaci√≥n es bimensual, esto es, se indaga por los viajes realizados durante los √∫ltimos dos meses. De esta forma, con el mecanismo de per√≠odos de referencia y ventanas de observaci√≥n implementados se logra que, para un mes determinado, se disponga de 5.200 casos para realizar las estimaciones de ese mes.
Estos y muchos m√°s aspectos se pueden profundizar en el recientemente publicado Documento Metodol√≥gico.

