Argentina cuenta con un patrimonio natural incomparable, que explica gran parte del flujo tur√≠stico interno y receptivo. Este movimiento es una fuente de empleo y desarrollo econ√≥mico de gran relevancia para nuestro pa√≠s, y uno de los principales motores productivos de numerosas econom√≠as regionales. En este sentido, se encuentra en marcha un programa integral de turismo de naturaleza llamado La Ruta Natural, con el cual Argentina se propone desarrollar territorios y comunidades con respeto a los valores naturales y la autenticidad cultural, como as√≠ tambi√©n promocionar viajes seguros y turismo sustentable a partir del turismo de naturaleza en todo el territorio nacional.
