Introducci√≥n
La Direcci√≥n Nacional de Mercados y Estad√≠stica (DNMyE) presenta la primera estimaci√≥n y difusi√≥n, en el marco de las estad√≠sticas oficiales de la Argentina, de una Cuenta Sat√©lite de Turismo (CST-A). Es resultado de un proyecto conjunto de colaboraci√≥n entre de la DNMyE-MINTURDEP y la Direcci√≥n Nacional de Cuentas Nacionales del Instituto Nacional de Estad√≠stica y Censos (DNCN-INDEC).
En una secci√≥n espec√≠fica del Sistema de Informaci√≥n Tur√≠stica de la Argentina (SINTA) se puede acceder al informe t√©cnico con informaci√≥n de los a√±os 2004 y 2016-2019, el documento metodol√≥gico y los principales cuadros estad√≠sticos.
Es el corolario de los a√±os invertidos en el desarrollo del Sistema de Estad√≠sticas de Turismo de la Argentina que consta de un conjunto de operaciones estad√≠sticas e investigaciones, principalmente integrado por:
La Encuesta de Turismo Internacional (ETI)
La Encuesta de Viajes y Turismo de los Hogares (EVyTH)
La Encuesta de Ocupaci√≥n Hotelera y parahotelera (EOH)
La explotaci√≥n de gran cantidad de registros administrativos (datos de tr√°nsitos de migraciones internacionales, visitas a los parques nacionales, precios, peajes, etc).
El Sistema de Estad√≠sticas de Turismo se integr√≥ a las cuentas nacionales de la Argentina elaboradas por el INDEC, que aport√≥ las cuentas de producci√≥n para los sectores tur√≠sticos y los cuadros de oferta y utilizaci√≥n, con su reciente actualizaci√≥n al a√±o 2018, que son la base para la estimaci√≥n de la serie de la CST-A.
¬øQu√© es la CST?
Es la herramienta recomendada por la Organizaci√≥n Mundial del Turismo, y reconocida por la comunidad internacional, para evaluar la importancia econ√≥mica del turismo, conocer las industrias que se benefician de la llegada de visitantes, cuantificar el valor agregado directo que se genera al satisfacer la demanda tur√≠stica y la generaci√≥n de empleo, entre otros. Actualmente 54 pa√≠ses tienen una Cuenta Sat√©lite de Turismo con actualizaci√≥n reciente. De ellos, 4 son sudamericanos: Colombia, Ecuador, Per√∫ y Uruguay1.
El prop√≥sito de la CST-A es analizar minuciosamente todos los aspectos de la demanda de bienes y servicios asociados con la actividad de los visitantes argentinos y extranjeros que recorren nuestro pa√≠s. Los principales resultados que muestra son una serie de indicadores econ√≥micos consistentes con las Cuentas Nacionales. Estos son:
Producto interno bruto directo tur√≠stico (PIBDT): se trata de la producci√≥n de bienes y servicios que se genera directamente por el consumo de los visitantes, sin importar la industria que los produjo. Surge de contrastar el consumo total de los visitantes (tur√≠stico interno y receptor) con la producci√≥n del pa√≠s.
Valor agregado bruto directo tur√≠stico (VABDT): corresponde a la parte del valor agregado bruto generado por todas las industrias de una econom√≠a, ya sean tur√≠sticas o no, que atendieron directamente al consumo de los visitantes.
Valor agregado bruto de la industria del turismo (VABIT): se refiere al Valor Agregado (es decir, la producci√≥n total excluyendo los consumos intermedios o insumos) de un conjunto de ramas de actividad que se consideran caracter√≠sticas del turismo (Gastronom√≠a, Alojamiento, Transporte, Agencias de Viaje, Actividades de Entretenimiento, Culturales y Deportivas, entre otras).
Empleo de la industria del turismo: corresponde al total de puestos de trabajo de las ramas de actividad caracter√≠sticas del turismo.
Principales resultados de la CST-A
Consumo Tur√≠stico Interior
El consumo tur√≠stico interior es el que realizan los visitantes para la adquisici√≥n de bienes o servicios en sus viajes m√°s los otros consumos imputados. En la CST-A, se analizan distintos aspectos del gasto tur√≠stico, seg√∫n la residencia de los visitantes:
‚Ä¢ Gasto Tur√≠stico Receptor: referido a los visitantes no residentes en la Argentina.
‚Ä¢ Gasto Tur√≠stico Interno: referido a visitantes residentes en la Argentina.



